import React from 'react';

const artworks = [
  { id: 1, artist: 'Artist One', cost: '$100' },
  { id: 2, artist: 'Artist Two', cost: '$200' },
  { id: 3, artist: 'Artist Three', cost: '$150' },
  { id: 4, artist: 'Artist Four', cost: '$250' },
  { id: 5, artist: 'Artist Five', cost: '$300' },
  { id: 6, artist: 'Artist Six', cost: '$180' },
];

export default function ArtworkList() {
  return (
    <div>
      <h1>Artworks</h1>
      <div style={{ display: 'flex', flexWrap: 'wrap', justifyContent: 'space-between' }}>
        {artworks.map((artwork) => (
          <div key={artwork.id} style={{ border: '1px solid #ccc', borderRadius: '8px', padding: '16px', margin: '8px', width: '30%' }}>
            <h2>{artwork.artist}</h2>
            <p>Cost: {artwork.cost}</p>
            <button style={{ backgroundColor: '#4CAF50', color: 'white', padding: '10px', border: 'none', borderRadius: '4px', cursor: 'pointer' }}>
              Add to Cart
            </button>
          </div>
        ))}
      </div>
    </div>
  );
}
